import React from 'react';
import 'header.scss';

 const header=()=>{

    return (
      <>
        <header>
          <div className="container">
            <div className="wrapper">
              <div className="row ">
                <div className="col-6 col-12">
                    <div className='col-lg-6 w-100'>
                    hello

                    </div>
                </div>
              </div>
            </div>
          </div>
        </header>
      </>
    );

}
export default header;
